import React from 'react'
import ReactDOM from 'react-dom'
import { responsive_mock } from './responsive.js'
export class Test_page extends React.Component{
    constructor(props){
        super(props)
        this.state={time:30,timer:responsive_mock.test_page.timer()}
    }
    componentDidMount(){
        this.starttimer()
    }
    starttimer(){
        if(this.state.time==0){alert(1);return;}
        setTimeout(()=>
        {
        this.setState((prev)=>{return {time:prev.time-1,timer:prev.timer}},this.starttimer)},1000);
    }
    render(){
        return<div>
            <div style={this.state.timer}>{this.state.time}</div>
        </div>
    }
}
